/*
    Is used to generate a new report for the user
    Will need to use the input to send to the backend, possibly redirect to another component
    @Notes: Lyka Marcelino, 04/09/2020
 */

import React from 'react';
import {Form, Button, Dropdown, InputGroup} from 'react-bootstrap';

const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "1200px",
    height: "600px",
    textAlign: "center",
    marginLeft: "220px",
    marginTop: "40px",
    alignContent: "center",
}

export default class NewReport extends React.Component {
    state = {
        fileName: "",
        predType: "",
        timeFreq: "",
        numPred: "",
    }

    render() {
        return(
            <Form style={{marginLeft: '20px', marginRight: '20px'}}>
                <Form.Group controlId="formFileName">
                    <Form.Label>File Name</Form.Label>
                    <Form.Control size="sm" placeholder="My New Report" />
                    <InputGroup>
                        className = "fileName"
                        onChange = {}
                    </InputGroup>
                </Form.Group>
            </Form>
        );
    }
}
